import axios from "axios";
import React, { Component } from "react";
import {
  Col,
  Container,
  Row,
  Card,
  CardImg,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  Button,
  NavItem,
  NavLink,
} from "reactstrap";
import ItemLibrary from "../components/ItemLibrary";

export default class Library extends Component {
  state = { books: [] };
  constructor() {
    super();
    this.getBooks();
  }
  getBooks = async () => {
    try {
      let data = await axios
        .get("http://localhost:3000/books")
        .then(({ data }) => data);
    } catch (error) {
      console.log(error);
    }
    this.setState({ books: data });
  };
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col xs="3">
              <ItemLibrary />
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
